description:
What is the Lord's will for your life today? Join our study in REVELATION 17 as we read through the symposiums of religion and government during the Tribulation. Here we gain a Biblical understanding of religious Babylon. Let's be those who fill our hearts with the true and living sacrifice, Jesus Christ.
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
